import React from 'react';
import './UserIcon.css'
const UserIcon = () => {
    return (
        <div className="user-icon">
            <i className="fa-solid fa-user"></i>
            <i className="fa-solid fa-check"></i>
        </div>
    );
};

export default UserIcon;
